CREATE PROCEDURE dbo.proc_transform_427
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_427
    SET payload = LEFT(payload, 1000) + N'|V4-427|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_427;
END
